// Navbar.jsx
import React from 'react';
import { Link } from 'react-router-dom';

const Navbar = () => {
  return (
    <nav>
      <ul>
        <li>
          <Link to="/casual">Casual</Link>
        </li>
        <li>
          <Link to="/professional">Professional</Link>
        </li>
      </ul>
    </nav>
  );
};

export default Navbar;
